import './App.css';
import React from 'react';
import Navbar from './components/navbar';
import Counters from './components/counters'
import 'bootstrap/dist/css/bootstrap.css'

function App() {
  return (
    <React.Fragment>
      <Navbar/>
      <main className="container">
       <Counters/>
      </main>
    </React.Fragment>
  );
}

export default App;
